import { useState, useEffect } from "react";
// import { Data } from "./emogiJson";

export const Main = () => {
  const url = " https://emoji.ymatuhin.workers.dev/";
  const [textInput, setInput] = useState([]);
  function DisplayInput() {
    // console.log(textInput);
    return (
      <div>
        <input onChange={(event) => setInput(event.target.value)} />
        {/* <div>{console.log(textInput)}</div> */}
      </div>
    );
  }

  //   const TextInput = (event) => event.target.value;
  const getData = async () => {
    let response = await fetch(url);
    let makeJson = await response.json();
    setInput(makeJson);
  };
  useEffect(async () => {
    DisplayInput();
    getData();
  }, []);
  return textInput.map((elem) => (
    <div>
      <div>{elem.title}</div>
      <div>{elem.symbol}</div>
      <div>{elem.keywords}</div>
    </div>
  ));
};
